@krasznaa you can run nm -C -D libonnxruntime.so to see which symbols are exposed by onnxruntime. When we run our Linux build, we generate a file called onnxruntime.lds (linker version script) that defines the symbols we expose. You can read more about this [here](https://ftp.gnu.org/old-gnu/Manuals/ld-2.9.1/html_node/ld_25.html). The contents of this file (for 1.0 release as an example) is as follows:

```
VERS_1.0.0 {
 global:
  OrtGetApiBase;
  OrtSessionOptionsAppendExecutionProvider_CPU;
 local:
    *;
};
```

Hence things should work on your end even with a different Eigen version. Have you tried it?
